import Layout from '../components/MyLayout';

const Index = props => (
    <Layout>
        <h3>PROFIL MAHASISWA STIKOM PGRI BANYUWANGI</h3>
        <h4>Nama : SANDY ADITYA PUTRA PRADANA<br/>
        TTL : Banyuwangi, 07 September 1999<br/>
        Alamat : Perum GGM Klatak Blok ST no 12<br/>
        Hobi : Memancing<br/>
        NIM : 1118101658<br/>
        JURUSAN : S1 TEKNIK INFORMATIKA - MALAM 
        </h4>
    </Layout>
);

export default Index;
